import React, {Component} from 'react';
import {Input} from 'antd';
class Login extends Component{
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className='Login'>
                <Input placeholder='Email'/>
            </div>
        )
    }
}
export default Login;
